<template>
  <section class="login-page fullScreen" @keydown.enter="submitForm">
    <div class="nav-header row">
    </div>
    <el-row type="flex" align="middle" class="login-main">
      <el-form ref="login-form" :model="loginModel" :rules="loginRule" class="login-form" style="background:#fff;"
               type="flex" align="middle">
        <el-row type="flex" justify="center" style="margin-top:20px">
          <h2>{{appConfig.name}}-管理端</h2>
        </el-row>
        <el-row type="flex" justify="center" style="margin-top:20px">
          <el-form-item prop="username">
            <el-input v-model="loginModel.username" auto-complete="off" placeholder="账号">
              <template slot="prefix">
                <svg-icon iconName="yonghuming"></svg-icon>
              </template>
            </el-input>
          </el-form-item>
        </el-row>
        <el-row type="flex" justify="center">
          <el-form-item prop="password">
            <el-input type="password" v-model="loginModel.password" placeholder="密码">
              <template slot="prefix">
                <svg-icon iconName="mima"></svg-icon>
              </template>
            </el-input>
          </el-form-item>
        </el-row>
        <el-row type="flex" justify="center">
          <el-form-item prop="code" class="captcha">
            <div class="captcha">
              <el-input
                ref="username"
                v-model="loginModel.code"
                style="width: 218px;"
                prefix-icon="el-icon-message"
                placeholder="验证码"
                name="username"
                type="text"
                tabindex="3"
                autocomplete="on"
              />
              <div class="imgs" @click="getCaptcha()"><img :src="captchatImg"></div>
            </div>
          </el-form-item>
        </el-row>
        <el-row type="flex" justify="center" style="display:none">
          <el-form-item class="remember">
            <el-checkbox class="remember_cb" v-model="remember">记住用户名和密码</el-checkbox>
          </el-form-item>
        </el-row>
        <el-row type="flex" justify="center" style="margin-top:10px">
          <el-form-item label-width="0px" style="text-align:center">
            <el-button type="" class="btn" @click="$refs['login-form'].resetFields()">重置</el-button>
            <el-button type="primary" class="btn" @click="submitForm">登录</el-button>
          </el-form-item>
        </el-row>
      </el-form>
    </el-row>
  </section>
</template>

<script lang="ts">
  import Vue from "vue";
  import Component from "vue-class-component";
  import SvgIcon from "~/components/common/svg-icon.vue"
  import AppConfig from "~/config/app.config"
  import {Dependencies} from "~/core/decorator";
  import {Action} from "vuex-class";
  import {StorageUtil} from '~/utils/storage.util';
  import {LoginService} from "~/server/services/system-manage-services/sys-login.service";
  import {ValidateCode} from '~/server/services/common-service/validate-code'

  @Component({
    components: {
      SvgIcon,
      // VerifyCode
    }
  })
  export default class Login extends Vue {
    @Dependencies(LoginService) private authService: LoginService;
    @Dependencies(ValidateCode) private comValidateService: ValidateCode;

    @Action("updateUserLoginData") updateUserLoginData;

    private loginRule: any = {
      username: {required: true, message: "用户名不能为空", trigger: "blur"},
      password: {required: true, message: "密码不能为空", trigger: "blur"},
      code: {required: true, message: "验证码不能为空", trigger: "blur"}
    };
    private loginModel: any = {
      username: "admin",
      password: "123456",
      code: '',
      key: ''
    };
    private appConfig: any = AppConfig;
    private remember: boolean = false;
    private captchatImg: any = '';

    mounted() {
      this.getCaptcha();
      sessionStorage.setItem("loginType", "");
      let rember: any = StorageUtil.getItem('remember')
      this.remember = !!rember
      if (rember) {
        this.loginModel = rember
      }
    }

    getCaptcha() {
      this.comValidateService.captchaApi().subscribe(data => {
        this.captchatImg = data.code
        this.loginModel.key = data.key
      }, ({msg}) => {
        this.$message.error(msg);
      })
    }

    /**
     * 提交登录表单
     */
    submitForm() {
      let loginForm: any = this.$refs["login-form"];
      loginForm.validate(success => {
        if (!success) {
          return;
        }

        if (this.remember) {
          StorageUtil.setItem('remember', this.loginModel)
        } else {
          StorageUtil.removeItem('remember')
        }

        this.authService
          .login({
            username: this.loginModel.username,
            password: this.loginModel.password,
            code: this.loginModel.code,
            key: this.loginModel.key
          })
          .subscribe(
            ({token, userInfo}) => {

              this.updateUserLoginData({token, userInfo});
              this.authService.getMenu({userId: userInfo.userId})
                .subscribe(
                  ({
                     null: any, data
                   }) => {
                    this.updateUserLoginData({null: any, userInfo, data});
                    this.$router.push("/sys-manage/business");
                    sessionStorage.setItem("loginType", "manage");
                  })
            },
            ({msg}) => {
              this.$message.error(msg);
              this.getCaptcha();
            }
          );
      });
    }
  }
</script>

